import React from 'react';

const Hobbies = () => {
    return (
        <div className='hobbies'>
            <h3>Intérêts</h3>
            <ul>
                <li><i className='fas fa-earth-europe'></i>
                Road Trip en 2017 (12 jours) sur la côte Ouest des États-Unis (San Francisco, Los Angeles, Las Vegas...).</li>
                <li><i className='fa-solid fa-earth-americas'></i>
                Mexique 2018 Région du Yucatán (Visite des temples Mayas)</li>
                <li><i className='fas fa-users'></i>
                Bénévole au sein de l'association l'Escale Solidaire (Epicerie Sociale)</li>
                <li><i className='fas fa-person-swimming'></i>
                Natation</li>
            </ul>
        </div>
    );
};

export default Hobbies;
